text:
Today, I stood with members of the CBC, CPC, and the DWC to denounce the politically motivated charges brought against Rep. LaMonica McIver. 

These accusations are nothing more than a distraction, to intimidate Democrats from carrying out critical oversight. 

@RepLaMonica, we stand with you.

#OTD, 24 years ago, @US_FDA approved the medication abortion pill mifepristone,
which has remained safe and effective since its approval. Today, I join
@ProChoiceCaucus  and @DemWomenCaucus  to remind @HouseGOP Members that we won't go back.
